  var getLocalTime = function (data) {
    //dd-mm-yyyy
    //12 hr format
    var date = new Date();
    var offset = date.getTimezoneOffset(); //currnet timezone offset in minutes
    var d = new Date(data);
    var localDate = calculateLocalDate(offset / 60, d);
    var period = "AM";

    if (localDate.getHours() >= 12 && localDate.getHours() <= 23) {
      period = "PM";
    }

    var datestring = (localDate.getDate() < 10 ? '0' : '') + localDate.getDate() + "-" + (localDate.getMonth() + 1 < 10 ? '0' : '') + (localDate.getMonth() + 1) + "-" + localDate.getFullYear() + " " +
      (localDate.getHours() <= 12 ? localDate.getHours() : (localDate.getHours() - 12)) + ":" + (localDate.getMinutes() < 10 ? '0' : '') + localDate.getMinutes() + " " + period;

    return datestring;
  }

