  var setCookie = function (name, value, days) {
    var expires = "";
    if (days) {
      var date = new Date();
      date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
      expires = "; expires=" + date.toUTCString();
    }
    document.cookie = name + "=" + (value || "") + expires + "; path=/";
  }

  var getCookie = function (name) {
    var nameEQ = name + "=";
    var ca = document.cookie.split(';');
    for (var i = 0; i < ca.length; i++) {
      var c = ca[i];
      while (c.charAt(0) == ' ') c = c.substring(1, c.length);
      if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length, c.length);
    }
    return null;
  }

  var eraseCookie = function (name) {
    document.cookie = name + '=; Path=/; Expires=Thu, 01 Jan 1970 00:00:01 GMT;';
  }

  function loadProviderListBalance(MemberVendorList, loginId) {
    //$("#transferFormHiddenField").html("");
    //$("#transferMobileFormHiddenField").html("");
    for (var i = 0; i < MemberVendorList.length; i++) {
      if (MemberVendorList[i].name != "Main") {
        let vendorId = MemberVendorList[i].id;
        let vendorAccountId = MemberVendorList[i].vendorAccountId;
        var data = { vendorId: vendorId, vendorAccountId: vendorAccountId, loginId: loginId, isFromDB: true };
        $.ajax({
          url: "/Member/GetMemberVendorBalance/",
          type: "GET",
          data: data,
          cache: false,
          success: function (data) {
            var balanceText = "";
            var ddlBalTxt = "";
            balanceText = data.balance.toFixed(2);
            ddlBalTxt = "(" + data.balance.toFixed(2) + ") " + getCurrency();
            if (data.lockedChipBalance > 0) {
              ddlBalTxt = "(" + data.balance.toFixed(2) + ") Chip";

              $('#transferFrom.vendorSelect option[value=' + data.name + ']').html(data.displayName.toUpperCase() + ' ' + ddlBalTxt).attr("data-amount", data.balance.toFixed(2)).attr("disabled", "disabled");
              $('.transferTo option[value=' + data.name + ']').html(data.displayName.toUpperCase() + ' ' + ddlBalTxt).attr("data-amount", data.balance.toFixed(2)).attr("data-vendorId", data.id).attr("data-vendorAccountId", data.vendorAccountId).attr("disabled", "disabled");
            } else {
              $('#transferFrom.vendorSelect option[value=' + data.name + ']').html(data.displayName.toUpperCase() + ' ' + ddlBalTxt).attr("data-amount", data.balance.toFixed(2)).removeAttr("disabled");
              $('.transferTo option[value=' + data.name + ']').html(data.displayName.toUpperCase() + ' ' + ddlBalTxt).attr("data-amount", data.balance.toFixed(2)).attr("data-vendorId", data.id).attr("data-vendorAccountId", data.vendorAccountId).removeAttr("disabled");
            }

          },
          error: function (e) {
            if (MemberVendorList[i].name === undefined) {
              toastr["error"]("Get Balance Failed.");
            }
            else {
              toastr["error"](MemberVendorList[i].name);
            }
            Site.HideLoading();
          }
        })
      }
    }
  }

  function loadChipProviderListBalance(MemberVendorList, loginId) {
    //$("#transferFormHiddenField").html("");
    //$("#transferMobileFormHiddenField").html("");
    for (var i = 0; i < MemberVendorList.length; i++) {
      if (MemberVendorList[i].name != "Main") {
        let vendorId = MemberVendorList[i].id;
        let vendorAccountId = MemberVendorList[i].vendorAccountId;
        var data = { vendorId: vendorId, vendorAccountId: vendorAccountId, loginId: loginId };
        $.ajax({
          url: "/Member/GetMemberVendorBalance/",
          type: "GET",
          data: data,
          cache: false,
          success: function (data) {
            var balanceText = "";
            var ddlBalTxt = "";
            balanceText = data.balance.toFixed(2);
            ddlBalTxt = "(" + data.balance.toFixed(2) + ") Chip";

            if (data.maintenance) {
              $('#transferFromChip.vendorSelect option[value=' + data.name + ']').html(data.displayName.toUpperCase() + ' (Maintenance)');
              $('#transferFromChip.vendorSelect option[value=' + data.name + ']').attr('disabled', 'disabled');
              $('.transferToChip option[value=' + data.name + ']').html(data.displayName.toUpperCase() + ' (Maintenance)');
              $('.transferToChip option[value=' + data.name + ']').attr('disabled', 'disabled');
            } else {
              if (data.lockedChipBalance == 0 && data.balance > 0) {
                // normal balance
                ddlBalTxt = "(" + data.balance.toFixed(2) + ") MYR";

                $('#transferFromChip.vendorSelect option[value=' + data.name + ']').html(data.displayName.toUpperCase() + ' ' + ddlBalTxt).attr("data-amount", data.balance.toFixed(2)).attr("data-lockedChipBalance");
                $('#transferFromChip.vendorSelect option[value=' + data.name + ']').attr('disabled', 'disabled');
                $('.transferToChip option[value=' + data.name + ']').html(data.displayName.toUpperCase() + ' ' + ddlBalTxt).attr("data-amount", data.balance.toFixed(2)).attr("data-lockedChipBalance", "0");
                $('.transferToChip option[value=' + data.name + ']').attr('disabled', 'disabled');

              } else {
                var lockedBalance = '';
                if (data.lockedChipBalance > 0) {
                  lockedBalance = ' (LockedBalance: ' + data.lockedChipBalance + ')'
                }

                $('#transferFromChip.vendorSelect option[value=' + data.name + ']').html(data.displayName.toUpperCase() + ' ' + ddlBalTxt + lockedBalance).attr("data-amount", data.balance.toFixed(2)).attr("data-lockedChipBalance", data.lockedChipBalance.toFixed(2));
                $('.transferToChip option[value=' + data.name + ']').html(data.displayName.toUpperCase() + ' ' + ddlBalTxt + lockedBalance).attr("data-amount", data.balance.toFixed(2)).attr("data-lockedChipBalance", data.lockedChipBalance.toFixed(2));
              }


            }
          },
          error: function (e) {
            toastr["error"](MemberVendorList[i].name);
            Site.HideLoading();
          }
        })
      }
    }
  }

