  var getCurrency = function () {
    var currency = Site.GetCookie("Currency");
    if (currency == null) {
      $.ajax({
        type: "GET",
        url: "GetCurrency/",
        async: false,
        success: function (data) {
          Site.SetCookie("Currency", data, 1);
          currency = data;
        }, error: function (jqXHR) {
          Site.Error();
          Site.HideLoading();
        }
      });
    }
    return currency;
  }

